  return (
    <Routes>
      <Route path="/" element={<Layout />}>

        {/* Le contenu de "element" est dans "<Outlet/>" */}
        <Route index element={ <IndexPage/> }/>
        <Route path={'/login'} element={ <div>Login page</div> } />
      </Route>
    </Routes>


  );
}

export default App;
